import React from "react";
import { Form } from "react-bootstrap";
import "../styles/Filter.css";

const Filter = ({ handleChange, diet }) => {
  return (
    <form>
      <div className="option">
        <input
          type="radio"
          id="inputbox"
          name="diet"
          value="Standard"
          onChange={handleChange}
          checked={diet}
        ></input>
        <label className="labelCheckbox" for="diet">
          {" "}
          Standard
        </label>
      </div>
      <div className="option">
        <input
          type="radio"
          id="inputbox"
          name="diet"
          value="Vegetarian"
          onChange={handleChange}
          checked={diet}
        ></input>
        <label className="labelCheckbox" for="diet">
          {" "}
          Vegetarian
        </label>
      </div>
      <div className="option">
        <input
          type="radio"
          id="inputbox"
          name="diet"
          value="Vegan"
          onChange={handleChange}
          checked={diet}
        ></input>
        <label className="labelCheckbox" for="diet">
          {" "}
          Vegan
        </label>
      </div>
    </form>
  );
};

export default Filter;
